import React, { useState } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Post from "./Post";
import Header from "./Header";

function App() {
  return (
    <BrowserRouter>
    <Routes>

     <Route path="/" element={
     <main>
     <Header />
     <Post/>
     </main>
     } />
     <Route path="login" element={<h1>"Login Page"</h1>} />

    </Routes>
    </BrowserRouter>
  );
}

export default App;
